import React from 'react';
import {
    View,
    Text
} from 'react-native';

const Home = () => {
    return (
        <View
            style={{
                flex: 1,
                alignItems: 'center',
                justifyContent: 'center'
            }}
        >
            <Text>Home</Text>
        </View>
    )
}

export default Home;
